import "./Cats.scss";
import { Link } from "react-router-dom";

function Cats(props) {
  const { id, name, image } = props;
  return (
    <div className="list">
      <Link to={`/cats/${id}`}>
        <img src={image} alt="" />
      </Link>
      <span>{name}</span>
    </div>
  );
}
export default Cats;
